  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments for the 1978 calendar year.
  The report begins by giving a brief introduction to the Refuge and describing the
  climate and habitat conditions in the Refuge, as well as funding and systems status.
  The construction and maintenance section describes recent construction, maintenance,
  and wildfires. The habitat management section discusses grasslands, grazing, haying,
  and wilderness and special areas. Wildlife- including endangered and threatened
  species, migratory birds, upland game birds, big game animals, predators, rodents,
  fish, reptiles, and raptors- are discussed. The public relations section discusses
  information and interpretation and recreational uses. Cooperative programs, items
  of interest, and safety are discussed. Photographs are attached.\",\n\t\"license_title\":
